【送料無料】<br><!-- 商品説明 ここから --><div class=cartRap><h3>商品説明</h3><p>★ 多彩な機能に手間なくアクセス<br />「スマートループ」の便利なコンテンツへ手間なくつながり続け、快適なドライブをサポートする専用通信モジュール。「マップチャージ」による地図更新（差分更新）や、CD録音した楽曲の「タイトルダウンロード」にも利用できます。しかも、最大3年間は何度データを取得しても、通信費用はかかりません。<br /><br />※ 「AVIC-VH99/ZH99/VH09/ZH09」をiPodやiPhone等と同時接続される場合には、別売USB接続ケーブル「CD-U120」が必要となります。<br /><br />※ 「AVIC-ZH77/ZH07/MRZ009/MRZ007/MRZ007-EV」を接続する場合は別売USB接続ケーブル「CD-U120」が必要となります。またiPodやiPhone等と同時接続される場合には、「CD-U120」は2つ必要となります。<br /><br />※ 「AVIC-MRP009/MRP008/MRP007/MRP006」を接続する場合は別売取付アタッチメント「AD-DC1」が必要となります。<br /><br />※ 通信を開通した月から最大3年間（ご利用開始日から当月末までの日数分＋35ヶ月間）無料です。以降は1年分ごとに通信契約（有料）することで、引き続きご利用いただけます。<br /><br />※ スマートループのご利用には、パソコンでのユーザー登録が必要です。登録をされていない場合は、オンデマンドVICSのみのデータ取得となります。<br /><br />※ 通信モジュールを使用したマップチャージは、差分データ更新のみ可能です。<br /><br />※ 株式会社NTTドコモのFOMAサービスを利用いた</p></div><!-- 商品説明 ここまで --><!-- 商品仕様 ここから --><div class=cartRap><h3>仕様</h3><p>* 対応モデル : <br />AVIC-VH99/ZH99/ZH77/VH09/ZH09/ZH07<br />AVIC-MRZ009/MRZ007<br />AVIC-MRP009/MRP008/MRP007/MRP006<br />AVIC-MRZ007-EV<br />AVIC-ZH09-MEV<br /><br />※ 最新の対応機種につきましては、メーカーホームページにてご確認をお願い致します。</p></div><!-- 商品仕様 ここまで --><!-- 共通説明文（大）-->
